webpackJsonp([0x6acc17f1efe0],{1359:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/mastering-photoshop-with-psdtutscom/index.md absPath of file >>> MarkdownRemark",html:'<p><a title="Open link in a new window" href="http://psdtuts.com/" target="_blank">Psdtuts</a> (Photoshop-document tutorials) hit the scene a little while ago on digg, and I\'ve had it on my RSS subscriptions ever since.  Off like a dynamo with the Photoshop tutorials, I\'d certainly keep an eye on it - looks to have potential to be another Smashing Magazine.  (i.e. A big hit)</p>\n<p>Now, my knowledge of Photoshop is ok, certainly on-par with those I work with,  but Psdtuts? I\'m a complete novice against them.  I tried to do a couple of their tutorials as a demonstration, but they didn\'t turn out so good.  They make it look so easy, but I guess you need some mystical, innate knowledge if you\'re going to compete.</p>\n<p style="text-align: center;"><a title="Open link in a new window" href="http://psdtuts.com/" target="_blank"><img src="/content/images/2007/10/11.jpg" alt="A sample improvement from photoshop" width="470" height="312" /></a></p>\n<p>My favourates have got to be;</p>\n<ul>\n\t<li><a title="Open link in a new window" href="http://psdtuts.com/photo-effects-tutorials/souping-up-a-photo/" target="_blank">Souping up a photo.</a></li>\n\t<li><a title="Open link in a new window" href="http://psdtuts.com/photo-effects-tutorials/super-slick-dusky-lighting-effects-in-photoshop/" target="_blank">Super-slick lighting effects</a></li>\n\t<li>[Creating an] <a title="Open link in a new window" href="http://psdtuts.com/designing-tutorials/creating-a-stunning-old-world-look-in-photoshop/" target="_blank">Olde Worlde look</a></li>\n</ul>\nWhat else can I say?  <a title="Open link in a new window" href="http://psdtuts.com/" target="_blank">go have a gawk</a>.',frontmatter:{title:"Mastering Photoshop with psdtuts.com",date:"October 08, 2007",tags:["design","external-links","resources"]}}},pathContext:{}}}});
